import React from "react";
import Navbar from "../navmenu/Navbar";
import Contact from "../Contact";
import { useTheme } from "@material-ui/core/styles";
import { withStyles } from "@material-ui/core/styles";
import { Typography, Avatar, Grid, Box } from "@material-ui/core";
import backgroundImg from "../../img/animal.jpg";

const styles = (theme) => ({
  contentArea: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    textAlign: "center",
    // width: "auto",
    // height: "auto",
    background: `url(${backgroundImg}) no-repeat center center`,
    zIndex: 1, // specifies stack order
    // border: "2px white solid",
    borderBottom: `3px ${theme.palette.primary.light} solid`,
    margin: "auto",
  },
});

const BlogPostTemplate = (props) => {
  const { classes } = props;
  const theme = useTheme();

  return (
    <Box className={classes.contentArea}>
      <Grid container justify="center">
        {/* <Avatar className={classes.avatar} src={avatar} alt="kelly he" /> */}
      </Grid>
      <Typography className={classes.title} variant="h4">
        hey i'm <span className={classes.highlight2}>kelly</span>
        {/* <Typed strings={["hey i'm kelly"]} typeSpeed={80}></Typed> */}
      </Typography>
      <Typography className={classes.subtitle} variant="h5"></Typography>
    </Box>
  );
};

export default withStyles(styles)(BlogPostTemplate);
